    }
  ]

    

  
  const [newName, setNewName] = useState("");
  const [newAge, setNewAge] = useState("");


  function getNewName (props){
    setNewAge(props.imie);
    setNewName(props.wiek);
    console.log(setNewAge);
    console.log(setNewName);
  }

  

  return (
    <li>
      <div>
        <Card>
          <NewForm onSaveDate={Wyniki}  onNewName={getNewName}/>
        </Card>
        <div>
          <Card>
            <p>{newName}</p>
            <p>{newAge}</p>
          </Card>
        </div>
      </div>
    </li>
  );
}

export default Wyniki;
